import React from 'react';

import classes from './Medidas.module.css'

const Medidas = (props) => {

    const form =props.medidas.map( medida =>(
        <label key={medida.altura}><span>medida.altura</span><span> </span><span>medida.ancho</span><span>medida.precio</span><input type="checkbox"  value="x"/></label>
    ))
    return ( 
        <div className={classes.Medidas}>
            <h2>Medidas</h2>
            <form>
               {form}
            </form>
        </div>
     );
}
 
export default Medidas;
